import React,{useState, useEffect} from "react";
import './Profile.css'

export default function Profile() {
  const [pic, setPic] = useState([])
  useEffect(()=>{
fetch("http://localhost:5000/myposts",
{
  headers:{
    Authorization: "Bearer "+ localStorage.getItem("jwt")
  }
}).then(res=> res.json()).then((result)=>{
  setPic(result)
})
  },[])
  return (
    <div className="profile">
      <div className="profile-frame">
        <div className="profile-pic">
          <img
            src="https://images.unsplash.com/photo-1597589827317-4c6d6e0a90bd?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8M3x8c3F1YXJlfGVufDB8fDB8fHww&auto=format&fit=crop&w=1000&q=60"
            alt=""
          />
        </div>
        <div className="profile-data">
          <h1>{JSON.parse(localStorage.getItem("user")).name}</h1>
          <div className="profile-info">
            <p>40 posts</p>
            <p>40 followers</p>
            <p>40 following</p>
          </div>
        </div>
      </div>
      <hr style={{
        width:"90%",
        margin:"auto",
        opacity:"0.8",
        margin:"25px auto"
      }}/>
      <div className="gallery">
        {pic.map((pic)=>{
          return <img key={pic.id}src={pic.photo} className="item"></img>
        })}
      </div>
    </div>
  );
}
